def test_parse_form_token():
    assert (
        _parse_form_token(_MY_RESPONSE) == "qwnjXYKZw02vx4TtdGdAgcuIoG1-7V56ge9Vocio0E0"
    )


def test_empty_rooms():
    rooms = []
    queried_date = datetime(2024, 5, 25)
    assert not _is_valid_data(rooms, queried_date)


def test_no_slots():
    rooms = [Room("Room1", available_slots=[], id="1")]
    queried_date = datetime(2024, 5, 25)
    assert not _is_valid_data(rooms, queried_date)


def test_slots_wrong_date():
    rooms = [
        Room("Room1", available_slots=[datetime(2024, 5, 24, 10, 0)], id="1"),
        Room("Room2", available_slots=[datetime(2024, 5, 24, 11, 0)], id="2"),
    ]
    queried_date = datetime(2024, 5, 25)
    assert not _is_valid_data(rooms, queried_date)


def test_slots_correct_date():
    rooms = [
        Room("Room1", available_slots=[datetime(2024, 5, 25, 10, 0)], id="1"),
        Room("Room2", available_slots=[datetime(2024, 5, 25, 11, 0)], id="2"),
    ]
    queried_date = datetime(2024, 5, 25)
    assert _is_valid_data(rooms, queried_date)


def test_multiple_rooms_correct_date():
    rooms = [
        Room("Room1", available_slots=[datetime(2024, 5, 25, 10, 0)], id="1"),
        Room("Room2", available_slots=[datetime(2024, 5, 25, 11, 0)], id="2"),
    ]
    queried_date = datetime(2024, 5, 25)
    assert _is_valid_data(rooms, queried_date)
